kotlin.String|มีปัญหาเรียกใช้ HomePage ใน App ทำไมยัง error ทั้งที่ประกาศ mod แล้ว

.
│   app.rs
│   main.rs
│
├───assets
├───components
├───page
│       home_page.rs
└───styles

// main.rs
#![allow(non_snake_case)]

pub mod app;
use app::App;

use dioxus::prelude::*;
use dioxus_logger::tracing::{info, Level};

fn main() {
    dioxus_logger::init(Level::INFO).expect("failed to init logger");
    info!("starting app");
    launch(App);
}


// app.rs
use dioxus::prelude::*;

mod home_page;
use home_page::HomePage;

#[component]
pub fn App() -> Element {
    rsx! {
        HomePage {}
    }
}

// home_page.rs
